var title_f4_21_4432="Vein distention SVC syndrome";
var content_f4_21_4432=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F76917&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F76917&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Superficial venous distention in superior vena cava syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 368px; height: 278px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A 65-year-old male smoker presented with non-productive cough, fatigue, worsening dyspnea on exertion, hoarseness, and a six month history of progressively enlarging veins over the anterior chest wall. Chest imaging study showed a right-sided superior sulcus (Pancoast) tumor that was compressing the superior vena cava with a serpentine-shaped posterior extension impinging upon the sympathetic chain, phrenic nerve (impairing diaphragmatic motility contributing to the dyspnea) and recurrent laryngeal nerve. Biopsy confirmed a bronchogenic adenocarcinoma.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Vaibhav Parekh, MD, MBA.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
