"    Spherules of Coccidioides spp in a transbronchial biopsy specimen stained with hematoxylin and eosin.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jeffrey Houck, MD.",
"    </div>",
"   </div>",
