"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     Feigin  RD, Cutrer W. Bacterial meningitis beyond the neonatal period. In: Textbook of Pediatric Infectious Diseases, 6th, Feigin RD, Cherry JD, Demmler-Harrison GJ, Kaplan SL (Eds), Saunders, Philadelphia 2009. p.439.",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?4/21/4442/abstract/2\">",
"      Bhatt SM, Lauretano A, Cabellos C, et al. Progression of hearing loss in experimental pneumococcal meningitis: correlation with cerebrospinal fluid cytochemistry. J Infect Dis 1993; 167:675.",
"     </a>",
"    </li>",
