var title_f4_21_4445="Treatment of leprosy in children";
var content_f4_21_4445=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F64965&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F64965&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Multidrug regimens for treatment of leprosy in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        National Hansens Disease Program (NHDP)*",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        World Health Organization (WHO)",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Regimen",
"       </td>",
"       <td class=\"subtitle2\">",
"        Dose",
"       </td>",
"       <td class=\"subtitle2\">",
"        Duration",
"       </td>",
"       <td class=\"subtitle2\">",
"        Dose",
"       </td>",
"       <td class=\"subtitle2\">",
"        Duration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Tuberculoid (\"paucibacillary\"): TT, BT",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dapsone",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        1 mg/kg daily (not to exceed 100 mg/day)",
"       </td>",
"       <td rowspan=\"2\">",
"        12 months",
"       </td>",
"       <td>",
"        50 mg daily",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td rowspan=\"2\">",
"        6 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rifampin",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        10 to 20 mg/kg daily (not to exceed 600 mg/day)",
"       </td>",
"       <td>",
"        450 mg once a month",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Lepromatous (\"multibacillary\"): LL, BL, BB",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dapsone",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        1 mg/kg daily (not to exceed 100 mg/day)",
"       </td>",
"       <td rowspan=\"3\">",
"        24 months",
"       </td>",
"       <td>",
"        50 mg daily",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td rowspan=\"3\">",
"        12 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rifampin",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        10 to 20 mg/kg daily (not to exceed 600 mg/day)",
"       </td>",
"       <td>",
"        450 mg once a month",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clofazimine",
"       </td>",
"       <td>",
"        1 mg/kg daily",
"        <sup>",
"         &yen;",
"        </sup>",
"        (not to exceed 50 mg daily)",
"       </td>",
"       <td>",
"        150 mg once a month, and 50 mg every other day",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Additional information available at NHDP website:",
"     <a href=\"file://www.hrsa.gov/hansensdisease/diagnosis/recommendedtreatment.html\" target=\"_blank\">",
"      file://www.hrsa.gov/hansensdisease/diagnosis/recommendedtreatment.html",
"     </a>",
"     .",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Additional information available at WHO website:",
"      <a href=\"file://www.searo.who.int/en/Section10/Section20/Section2000.htm\" target=\"_blank\">",
"       file://www.searo.who.int/en/Section10/Section20/Section2000.htm",
"      </a>",
"      .",
"      <br>",
"       &Delta; TT, BT, BB, BL, and LL refer to the Ridley-Jopling classification (see text).",
"       <br>",
"        <span class=\"lozenge\">",
"         &loz;",
"        </span>",
"        Oral suspension may be compounded. See Lexicomp Pediatric drug information: Extemporaneous preparations.",
"        <br>",
"         &sect; WHO advises dose adjustment for children &lt;10 years: dapsone 25 mg daily and rifampin 300 mg monthly.",
"         <br>",
"          &yen; As there is no formulation of clofazimine less than 50 mg, and the capsule should never be cut open, alternate day dosing (2 mg/kg every other day) may be used. Clofazimine should be taken either with or immediately after food or milk to facilitate absorption. In the United States, the NHDP holds the Investigational New Drug (IND) for treatment of leprosy. For further information or to request investigator status to use clofazimine, contact the NHDP: 1-800-642-2477.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
