var title_f4_21_4446="Four habits model";
var content_f4_21_4446=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F69929&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F69929&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Approach to effective clinical communication",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Habit",
"       </td>",
"       <td class=\"subtitle1\">",
"        Skills",
"       </td>",
"       <td class=\"subtitle1\">",
"        Techniques and examples",
"       </td>",
"       <td class=\"subtitle1\">",
"        Payoff",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Invest in the beginning",
"       </td>",
"       <td>",
"        Create rapport quickly",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Introduce self to everyone in the room",
"        </p>",
"        <p>",
"         &bull; Acknowledge patient wait time, if appropriate",
"        </p>",
"        <p>",
"         &bull; Convey knowledge of patient's history by commenting on prior visit or problem",
"        </p>",
"        <p>",
"         &bull; Attend to patient's comfort",
"        </p>",
"        <p>",
"         &bull; Make a social comment or ask a nonmedical question to put patient at ease",
"        </p>",
"        <p>",
"         &bull; Adapt own language, pace, and posture in response to patient",
"        </p>",
"       </td>",
"       <td rowspan=\"3\">",
"        <p>",
"         &bull; Establishes a welcoming atmosphere",
"        </p>",
"        <p>",
"         &bull; Allows faster access to real reason for visit",
"        </p>",
"        <p>",
"         &bull; Increases diagnostic accuracy",
"        </p>",
"        <p>",
"         &bull; Requires less work",
"        </p>",
"        <p>",
"         &bull; Minimizes \"Oh, by the way...\" at the end of visit",
"        </p>",
"        <p>",
"         &bull; Facilitates negotiating an agenda",
"        </p>",
"        <p>",
"         &bull; Decreases potential for conflict",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elicit patient's concerns",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Start with open-ended questions:",
"        </p>",
"        <p>",
"         &nbsp;&nbsp;- \"What would you like help with today?\" OR,",
"        </p>",
"        <p>",
"         &nbsp;&nbsp;- \"I understand that you're here for... Could you tell me more about that?\"",
"        </p>",
"        <p>",
"         &nbsp;&nbsp;- \"What else?\"",
"        </p>",
"        <p>",
"         &bull; Speak directly with patient when using an interpreter",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Plan the visit with the patient",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Repeat concerns back to check understanding",
"        </p>",
"        <p>",
"         &bull; Let patient know what to expect: \"How about if we start with talking more about..., then I'll do an exam, and then we'll go over possible tests/ways to treat this? Sound OK?\"",
"        </p>",
"        <p>",
"         &bull; Prioritize when necessary: \"Let's make sure we talk about X and Y.  It sounds like you also want to make sure we cover Z.  If we can't get to the other concerns, let's...\"",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Elicit the patient's perspective",
"       </td>",
"       <td>",
"        Ask for patient's ideas",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Assess patient's point of view:",
"        </p>",
"        <p>",
"         &nbsp;&nbsp;- \"What do you think is causing your symptoms?",
"        </p>",
"        <p>",
"         &nbsp;&nbsp;- \"What worries you most about this problem?\"",
"        </p>",
"        <p>",
"         &bull; Ask about ideas from significant others",
"        </p>",
"       </td>",
"       <td rowspan=\"3\">",
"        <p>",
"         &bull; Respects diversity",
"        </p>",
"        <p>",
"         &bull; Allows patient to provide important diagnostic clues",
"        </p>",
"        <p>",
"         &bull; Uncovers hidden concerns",
"        </p>",
"        <p>",
"         &bull; Reveals use of alternative treatments or requests for tests",
"        </p>",
"        <p>",
"         &bull; Improves diagnosis of depression and anxiety",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elicit specific requests",
"       </td>",
"       <td>",
"        &bull; Determine patient's goal in seeking care: \"When you've been thinking about this visit, how were you hoping I could help?\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Explore the impact on the patient's life",
"       </td>",
"       <td>",
"        &bull; Check context: \"How has the illness affected your daily activities/work/family?\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        Demonstrate empathy",
"       </td>",
"       <td>",
"        Be open to patient's emotions",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Assess changes in body language and voice tone",
"        </p>",
"        <p>",
"         &bull; Look for opportunities to use brief empathetic comments or gestures",
"        </p>",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         &bull; Adds depth and meaning to the visit",
"        </p>",
"        <p>",
"         &bull; Builds trust, leading to better diagnostic information, adherence, and outcomes",
"        </p>",
"        <p>",
"         &bull; Makes limit-setting or saying \"no\" easier",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Make at least one empathetic statement",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Name a likely emotion: \"That sounds really upsetting.\"",
"        </p>",
"        <p>",
"         &bull; Compliment patient on efforts to address problem",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Convey empathy nonverbally",
"       </td>",
"       <td>",
"        &bull; Use a pause, touch, or facial expression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Be aware of your own reactions",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Use own emotional response as a clue to what patient might be feeling",
"        </p>",
"        <p>",
"         &bull; Take a brief break if necessary",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        Invest in the end",
"       </td>",
"       <td>",
"        Deliver diagnostic information",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Frame diagnosis in terms of patient's original concerns",
"        </p>",
"        <p>",
"         &bull; Test patient's comprehension",
"        </p>",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         &bull; Increases potential for collaboration",
"        </p>",
"        <p>",
"         &bull; Influences health outcomes",
"        </p>",
"        <p>",
"         &bull; Improves adherence",
"        </p>",
"        <p>",
"         &bull; Reduces return calls and visits",
"        </p>",
"        <p>",
"         &bull; Encourages self care",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Provide education",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Explain rationale for tests and treatments",
"        </p>",
"        <p>",
"         &bull; Review possible side effects and expected course of recovery",
"        </p>",
"        <p>",
"         &bull; Recommend lifestyle changes",
"        </p>",
"        <p>",
"         &bull; Provide written materials and refer to other sources",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Involve patient in making decisions",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Discuss treatment goals",
"        </p>",
"        <p>",
"         &bull; Explore options, listening for the patient's preferences",
"        </p>",
"        <p>",
"         &bull; Set limits respectfully: \"I can understand how getting that test makes sense to you. From my point of view, since the results won't help us diagnose or treat your symptoms, I suggest we consider this instead.\"",
"        </p>",
"        <p>",
"         &bull; Assess patient's ability and motivation to carry out plan",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Complete the visit",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Ask for additional questions: \"What questions do you have?\"",
"        </p>",
"        <p>",
"         &bull; Assess satisfaction: \"Did you get what you needed?\"",
"        </p>",
"        <p>",
"         &bull; Reassure patient of ongoing care",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Frankel RM, Stein T. Getting the most out of the clinical encounter: The Four Habits Model. J Med Pract Manage 2001; 16:184. Copyright &copy;2001 Greenbranch Publishing.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.mpmnetwork.com\">",
"      file://www.mpmnetwork.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
